import React, { useEffect, useState } from 'react';
import apiGetJobs from '../api_call/getJobs';
import jobsList from '../api_call/manualLibrary';
import JobCard from '../components/JobCard';

function Jobs() {
  const [jobs, setJobs] = useState([]);
  useEffect(() => {
    const getJobs = async () => {
      setJobs(await apiGetJobs());
    }
    getJobs();
  // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);
  console.log(jobs);

  return(
    <div>
      Hello World!
      {
        jobs.length > 0 ? 
          jobs.map((job) => (
            <JobCard value={ job } />
          ))
         : 
          jobsList.map((job) => (
            <JobCard value={ job } />
          ))
      }
    </div>
  );
}

export default Jobs;
